import React from 'react';
import Tarjeta from './Tarjeta';



const productos = [
  {
    id: 1,
    imagen: 'https://via.placeholder.com/280x180',
    nombre: 'Camisa Casual',
    descripcion: 'Camisa de algodón 100%, cómoda y elegante para cualquier ocasión.',
    precio: '45.99',
  },
  {
    id: 2,
    imagen: 'https://via.placeholder.com/280x180',
    nombre: 'Pantalón Formal',
    descripcion: 'Pantalón elegante, perfecto para la oficina o eventos especiales.',
    precio: '60.00',
  },
  {
    id: 3,
    imagen: 'https://via.placeholder.com/280x180',
    nombre: 'Chaqueta de Invierno',
    descripcion: 'Chaqueta cálida y resistente para los días más fríos.',
    precio: '120.50',
  },
  // agrega más productos aquí
];

const Catalogo = () => {
  return (
    <div style={styles.container}>
      {productos.map(({ id, imagen, nombre, descripcion, precio }) => (
        <Tarjeta 
          key={id}
          imagen={imagen}
          nombre={nombre}
          descripcion={descripcion}
          precio={precio}
        />
      ))}
    </div>
  );
};

const styles = {
  container: {
    display: 'flex',
    flexWrap: 'wrap',
    justifyContent: 'center',
    gap: '2rem',
    padding: '2rem',
    backgroundColor: '#f9f9f9',
  },
};

export default Catalogo;
